    output r8 as UserActivity.record;
    output r7 as test_usdcx_bridge.aleo/UsdcRecord.record;
    output r6 as test_usdcx_bridge.aleo/UsdcRecord.record;
    output r9 as usdc_lending_pool.aleo/deposit.future;

finalize deposit:
    input r0 as u64.public;
    input r1 as field.public;
    get.or_use user_total_deposits[r1] 0u64 into r2;
    add r2 r0 into r3;
    set r3 into user_total_deposits[r1];
    contains total_supplied[0u8] into r4;
    contains total_borrowed[0u8] into r5;
    and r4 r5 into r6;
    branch.eq r6 false to end_then_0_0;
    get total_supplied[0u8] into r7;
    get total_borrowed[0u8] into r8;
    add r7 r0 into r9;
    set r9 into total_supplied[0u8];
    is.eq r9 0u64 into r10;
    branch.eq r10 false to end_then_1_2;
    set 0u64 into utilization_index[0u8];
    branch.eq true true to end_otherwise_1_3;
    position end_then_1_2;
    mul r8 1000000u64 into r11;
    div r11 r9 into r12;
    set r12 into utilization_index[0u8];
    position end_otherwise_1_3;
    branch.eq true true to end_otherwise_0_1;
    position end_then_0_0;
    contains total_supplied[0u8] into r13;
