    is.eq r20 0u64 into r21;
    branch.eq r21 false to end_then_3_10;
    set 0u64 into utilization_index[0u8];
    branch.eq true true to end_otherwise_3_11;
    position end_then_3_10;
    mul r19 1000000u64 into r22;
    div r22 r20 into r23;
    set r23 into utilization_index[0u8];
    position end_otherwise_3_11;
    branch.eq true true to end_otherwise_2_9;
    position end_then_2_8;
    set r0 into total_supplied[0u8];
    set 0u64 into utilization_index[0u8];
    position end_otherwise_2_9;
    position end_otherwise_1_5;
